import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AuthService } from 'src/app/core/services/auth.service';

@Component({
  selector: 'app-inmobiliaria',
  templateUrl: './inmobiliaria.component.html',
  styleUrls: ['./inmobiliaria.component.css'],
})
export class InmobiliariaComponent {
  constructor(private authService: AuthService, private router: Router) {}

  logout() {
    this.authService.logout();
  }
}
<mat-toolbar color="primary">
  <span class="logo" routerLink="/">INMOBILIARIA</span>
  <nav>
    <ul class="nav-list">
      <li><a mat-button routerLink="/compras">Compras</a></li>
      <li><a mat-button routerLink="/ventas">Ventas</a></li>
    </ul>
  </nav>
  <span class="flex-spacer"></span>

  <button mat-icon-button aria-label="Salir" (click)="logout()">
    <mat-icon>exit_to_app</mat-icon>
  </button>
</mat-toolbar>

<router-outlet></router-outlet>
